import React from "react";

const styles = {
    photo: {
        width: "100%",
        height: "100%"
    }
}

const Photo = props => (
    <img src={props.url} className="col-lg-2 col-md-2 col-sm-3 col-xs-4" style={styles.photo}></img>
);

export default Photo;
